INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (1,1,1,'I tried resetting my password but still cannot access my account. The error message says \"Invalid credentials\" even with the new password.','2025-10-14 21:45:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (2,1,2,'I can see the issue in your account. There was a temporary glitch with the password reset system. I have manually reset your account and sent you a new temporary password. Please check your email and log in with the new credentials.','2025-10-14 22:15:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (3,1,1,'Thank you! I received the email and can now access my account. The new password works perfectly.','2025-10-14 22:30:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (4,1,2,'Great! Please remember to change your password to something secure once you are logged in. Is there anything else I can help you with?','2025-10-14 22:45:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (5,2,1,'I keep getting an error when trying to register for the marathon. It says \"Registration failed\" but does not give any specific reason.','2025-10-18 01:35:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (6,2,13,'I can see the issue. The marathon event has reached its maximum capacity. However, I notice there is a waiting list available. Would you like me to add you to the waiting list?','2025-10-18 02:00:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (7,2,1,'Yes, please add me to the waiting list. When will I know if a spot becomes available?','2025-10-18 02:15:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (8,2,13,'I have added you to the waiting list. You will be notified by email if a spot becomes available. The waiting list is processed on a first-come, first-served basis.','2025-10-18 02:30:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (9,4,2,'My credit card payment keeps failing when I try to register for events. I have checked with my bank and there are no issues on their end.','2025-10-12 04:00:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (10,4,25,'I can see the payment attempts in our system. The issue appears to be with the CVV verification. Please ensure you are entering the correct 3-digit security code from the back of your card.','2025-10-12 04:30:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (11,4,2,'I double-checked the CVV and it is correct. The error message says \"Payment declined by bank\" but my bank says the card is fine.','2025-10-12 04:45:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (12,4,25,'I have processed a test transaction and found the issue. There was a temporary problem with our payment processor. I have manually registered you for the event and processed the payment through our backup system. You should receive a confirmation email shortly.','2025-10-12 05:20:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (13,5,2,'I cannot update my profile information. The save button does not work and I get no error message.','2025-10-15 22:45:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (14,5,37,'I can see the issue. There is a JavaScript error preventing the form from submitting. I have fixed this on our end. Please try updating your profile again and let me know if you encounter any issues.','2025-10-15 23:00:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (15,5,2,'Perfect! I was able to update my profile successfully. Thank you for the quick fix.','2025-10-15 23:15:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (16,7,3,'My race results from the marathon last weekend are not showing up in my profile. I completed the race and should have a time recorded.','2025-10-13 19:35:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (17,7,2,'I can see your race registration but the results are indeed missing. Let me check with the race organizers to get your official time. I will update your results as soon as I receive the information.','2025-10-13 20:15:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (18,7,3,'Thank you! I finished in 3 hours 45 minutes if that helps with the verification.','2025-10-13 20:30:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (19,7,2,'Perfect! I have updated your race results with the time of 3:45:00. Your results should now be visible in your profile and will be included in your performance analytics.','2025-10-13 21:30:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (20,8,3,'The mobile app crashes every time I try to view event details. This happens on both iOS and Android devices.','2025-10-17 02:25:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (21,8,43,'I can reproduce this issue. There is a bug in the latest app version when loading event details with certain special characters. We have identified the fix and will release an update within 24 hours. In the meantime, you can use the web version to view event details.','2025-10-17 02:45:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (22,8,3,'Thanks for the quick response. I will use the web version for now and wait for the app update.','2025-10-17 03:00:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (23,10,4,'I requested a password reset but never received the email. I checked my spam folder and it is not there either.','2025-10-12 23:30:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (24,10,51,'I can see the password reset request in our system but the email was not sent due to a temporary issue with our email service. I have manually sent you a new password reset link. Please check your email now.','2025-10-13 00:15:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (25,10,4,'I received the email and successfully reset my password. Thank you for the help!','2025-10-13 01:45:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (26,11,4,'I need to cancel my registration for the cycling event this weekend due to an injury. How do I do this?','2025-10-15 20:45:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (27,11,64,'I can help you cancel your registration. Since the event is this weekend, there may be a cancellation fee depending on the event policy. Let me check the specific terms for this event.','2025-10-15 21:00:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (28,11,4,'I understand there might be a fee. I just need to cancel as soon as possible due to my injury.','2025-10-15 21:15:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (29,11,64,'I have cancelled your registration. Since you are cancelling due to injury, we are waiving the cancellation fee. You will receive a full refund within 3-5 business days. I hope you recover quickly!','2025-10-15 21:20:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (30,13,5,'I created my account but never received the verification email. I cannot access most features without verification.','2025-10-11 03:45:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (31,13,2,'I can see your account is indeed unverified. There was an issue with our email verification system yesterday. I have manually verified your account and you should now have full access to all features.','2025-10-11 04:30:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (32,13,5,'Excellent! I can now access all the features. Thank you for resolving this quickly.','2025-10-11 05:15:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (33,16,1,'I noticed several login attempts from IP addresses I do not recognize. This is very concerning.','2025-10-24 01:45:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (34,16,2,'I have immediately locked your account and reset your password. I am also monitoring for any suspicious activity. Please check your email for the new login credentials.','2025-10-24 02:15:00');
INSERT INTO `help_replies` (`reply_id`, `request_id`, `sender_id`, `reply_content`, `created_at`) VALUES (35,16,1,'Thank you for the quick response. I have received the new password and will enable 2FA immediately.','2025-10-24 02:45:00');
