-- =============================================
-- Timestamp Normalization: Fix Future Dates
-- Ensures all timestamps in help_requests and help_replies
-- follow logical chronological order:
-- 1. created_at <= NOW() (no future dates)
-- 2. updated_at >= created_at (update after creation)
-- 3. resolved_at >= created_at (resolution after creation)
-- 4. resolved_at >= last reply time (resolve after last reply)
-- 5. help_replies.created_at >= help_requests.created_at (replies after requests)
-- 6. assigned_to must be support_technician user_id only
-- =============================================

SET @now := NOW();

-- 1) Limit all help_requests timestamps to valid ranges
-- Fix created_at first
UPDATE help_requests
SET created_at = LEAST(created_at, @now)
WHERE request_id >= 1;

-- Fix updated_at
UPDATE help_requests
SET updated_at = GREATEST(LEAST(updated_at, @now), LEAST(created_at, @now))
WHERE request_id >= 1;

-- Fix resolved_at
UPDATE help_requests
SET resolved_at = CASE 
  WHEN resolved_at IS NULL THEN NULL
  ELSE GREATEST(LEAST(resolved_at, @now), LEAST(created_at, @now))
END
WHERE request_id >= 1;

-- Fix last_staff_reply_at
UPDATE help_requests
SET last_staff_reply_at = CASE
  WHEN last_staff_reply_at IS NULL THEN NULL
  ELSE GREATEST(LEAST(last_staff_reply_at, updated_at, @now), created_at)
END
WHERE request_id >= 1;

-- 2) Ensure help_replies.created_at is within request's valid time window
-- Window: [request.created_at, COALESCE(request.resolved_at, request.updated_at, @now)]
UPDATE help_replies hr
JOIN help_requests r ON r.request_id = hr.request_id
SET hr.created_at = GREATEST(
  r.created_at,
  LEAST(hr.created_at, COALESCE(r.resolved_at, r.updated_at, @now), @now)
)
WHERE hr.reply_id >= 1;

-- 3) Ensure help_requests.updated_at is at least the last reply time
UPDATE help_requests r
LEFT JOIN (
  SELECT request_id, MAX(created_at) AS max_reply_at
  FROM help_replies
  GROUP BY request_id
) x ON x.request_id = r.request_id
SET r.updated_at = GREATEST(
  LEAST(COALESCE(x.max_reply_at, r.updated_at, r.created_at), @now),
  r.created_at
)
WHERE r.request_id >= 1;

-- 4) For solved tickets, ensure resolved_at is at least the last reply time
UPDATE help_requests r
LEFT JOIN (
  SELECT request_id, MAX(created_at) AS max_reply_at
  FROM help_replies
  GROUP BY request_id
) x ON x.request_id = r.request_id
SET r.resolved_at = CASE
  WHEN r.status = 'solved' AND r.resolved_at IS NOT NULL THEN
    GREATEST(
      LEAST(r.resolved_at, @now),
      r.created_at,
      COALESCE(x.max_reply_at, r.created_at)
    )
  ELSE r.resolved_at
END
WHERE r.request_id >= 1;

-- 5) Fix assigned_to: must only be support_technician user_ids
-- Set to NULL if currently assigned to non-support_technician users
UPDATE help_requests hr
LEFT JOIN users u ON hr.assigned_to = u.user_id
SET hr.assigned_to = NULL
WHERE hr.request_id >= 1 
  AND hr.assigned_to IS NOT NULL 
  AND (u.user_id IS NULL OR u.platform_role != 'support_technician');

-- 6) Fix last_staff_reply_at: ensure it's after created_at for avg_response_time calculation
-- If last_staff_reply_at < created_at, set it to NULL
UPDATE help_requests
SET last_staff_reply_at = NULL
WHERE request_id >= 1 
  AND last_staff_reply_at IS NOT NULL 
  AND last_staff_reply_at < created_at;

-- =============================================
-- Event Members timestamp normalization
-- =============================================

-- 7) Fix event_members.registration_date: ensure it's not in the future
UPDATE event_members em
JOIN event_info e ON em.event_id = e.event_id
SET em.registration_date = LEAST(em.registration_date, @now)
WHERE em.registration_date > @now AND em.membership_id >= 1;

-- 8) Fix event_members.assigned_at (for volunteers): ensure it's not in the future
UPDATE event_members
SET assigned_at = LEAST(assigned_at, @now)
WHERE assigned_at IS NOT NULL AND assigned_at > @now AND membership_id >= 1;

-- 9) Ensure registration_date is before or on event date
-- This is a logical constraint
UPDATE event_members em
JOIN event_info e ON em.event_id = e.event_id
SET em.registration_date = LEAST(em.registration_date, 
    DATE_ADD(e.event_date, INTERVAL 1 DAY))
WHERE em.registration_date > DATE_ADD(e.event_date, INTERVAL 1 DAY) AND em.membership_id >= 1;

-- =============================================
-- Helpdesk Logic Consistency Checks
-- =============================================

-- 10) Auto-assign to first staff reply if not assigned but has staff replies
-- Rule: If unassigned but has staff replies, assign to first staff responder
UPDATE help_requests hr
JOIN (
  SELECT r.request_id,
         MIN(r.created_at) AS first_reply_time,
         SUBSTRING_INDEX(
           GROUP_CONCAT(CASE WHEN u.platform_role IN ('support_technician','super_admin')
                             THEN CONCAT(r.created_at, '|', r.sender_id)
                        END ORDER BY r.created_at ASC SEPARATOR ','),
           ',', 1
         ) AS first_staff_reply
  FROM help_replies r
  JOIN users u ON u.user_id = r.sender_id
  GROUP BY r.request_id
) x ON x.request_id = hr.request_id
SET hr.assigned_to = SUBSTRING_INDEX(x.first_staff_reply, '|', -1)
WHERE hr.assigned_to IS NULL
  AND x.first_staff_reply IS NOT NULL
  AND hr.request_id >= 1;

-- 11) If assigned but status is 'new', change to 'assigned'
UPDATE help_requests
SET status = 'assigned'
WHERE status = 'new' 
  AND assigned_to IS NOT NULL
  AND request_id >= 1;

-- 12) If unassigned but status is 'solved', change back to 'assigned' (if has replies) or 'new'
UPDATE help_requests
SET status = CASE
  WHEN last_staff_reply_at IS NOT NULL THEN 'assigned'
  ELSE 'new'
END
WHERE assigned_to IS NULL 
  AND status = 'solved'
  AND request_id >= 1;

-- 13) Fix last_staff_reply_at for requests that have staff replies but missing this field
UPDATE help_requests hr
JOIN (
  SELECT request_id, MAX(created_at) AS max_staff_reply_at
  FROM help_replies r
  JOIN users u ON u.user_id = r.sender_id
  WHERE u.platform_role IN ('support_technician','super_admin')
  GROUP BY request_id
) s ON s.request_id = hr.request_id
SET hr.last_staff_reply_at = GREATEST(
  COALESCE(hr.last_staff_reply_at, s.max_staff_reply_at),
  s.max_staff_reply_at
)
WHERE hr.request_id >= 1
  AND (hr.last_staff_reply_at IS NULL OR hr.last_staff_reply_at < s.max_staff_reply_at);

-- 14) Ensure all timestamps are not in future (comprehensive check)
UPDATE help_requests
SET created_at = LEAST(created_at, @now),
    updated_at = LEAST(GREATEST(updated_at, created_at), @now),
    resolved_at = CASE 
      WHEN resolved_at IS NULL THEN NULL
      ELSE LEAST(GREATEST(resolved_at, created_at), @now)
    END,
    last_staff_reply_at = CASE
      WHEN last_staff_reply_at IS NULL THEN NULL
      ELSE LEAST(GREATEST(last_staff_reply_at, created_at), @now)
    END
WHERE request_id >= 1;

-- 15) BEFORE deleting replies, change status of requests with staff replies to 'assigned'
-- This way we only keep 'new' for truly new requests without staff interaction
UPDATE help_requests hr
JOIN (
  SELECT DISTINCT r.request_id 
  FROM help_replies r
  JOIN users u ON r.sender_id = u.user_id
  WHERE u.platform_role IN ('support_technician', 'super_admin')
) x ON hr.request_id = x.request_id
SET hr.status = 'assigned'
WHERE hr.status = 'new'
  AND hr.request_id >= 1;

-- 16) Delete staff replies for requests that are STILL 'new' status (after step 15)
-- If status is still 'new' after step 15, delete all staff replies to reset to original state
DELETE hr FROM help_replies hr
JOIN help_requests r ON hr.request_id = r.request_id
JOIN users u ON hr.sender_id = u.user_id
WHERE r.status = 'new'
  AND u.platform_role IN ('support_technician', 'super_admin');

-- 17) Reset statistics for requests that are truly 'new' status
-- Clear last_staff_reply_at, resolved_at for newly reset requests
UPDATE help_requests
SET last_staff_reply_at = NULL,
    resolved_at = NULL,
    updated_at = created_at
WHERE status = 'new'
  AND (last_staff_reply_at IS NOT NULL OR resolved_at IS NOT NULL)
  AND request_id >= 1;

-- Quick responses for urgent/high priority (15-60 minutes)
UPDATE help_requests 
SET last_staff_reply_at = DATE_ADD(created_at, INTERVAL (15 + FLOOR(RAND() * 45)) MINUTE)
WHERE priority IN ('urgent', 'high')
  AND status IN ('solved', 'assigned')
  AND last_staff_reply_at IS NOT NULL
  AND RAND() < 0.7;  -- 70% of urgent/high get quick response

-- Medium responses for medium priority (1-4 hours)
UPDATE help_requests 
SET last_staff_reply_at = DATE_ADD(created_at, INTERVAL (60 + FLOOR(RAND() * 180)) MINUTE)
WHERE priority = 'medium'
  AND status IN ('solved', 'assigned')
  AND last_staff_reply_at IS NOT NULL
  AND RAND() < 0.6;  -- 60% of medium get medium response

-- Longer responses for low priority (4-24 hours)
UPDATE help_requests 
SET last_staff_reply_at = DATE_ADD(created_at, INTERVAL (240 + FLOOR(RAND() * 1200)) MINUTE)
WHERE priority = 'low'
  AND status IN ('solved', 'assigned')
  AND last_staff_reply_at IS NOT NULL
  AND RAND() < 0.5;  -- 50% of low get longer response

-- Ensure last_staff_reply_at is always after created_at

UPDATE help_requests 
SET last_staff_reply_at = DATE_ADD(created_at, INTERVAL 1 MINUTE)
WHERE last_staff_reply_at IS NOT NULL
  AND last_staff_reply_at <= created_at
  AND request_id > 0;  -- Add key column condition to satisfy safe update mode

-- List of request IDs to clean: 113, 109, 102, 148, 147, 144, 159, 157, 153, 151, 139, 132, 129, 128, 114

-- Delete staff replies except the first one for each request
DELETE hr FROM help_replies hr
JOIN users u ON hr.sender_id = u.user_id
WHERE hr.request_id IN (113, 109, 102, 148, 147, 144, 159, 157, 153, 151, 139, 132, 129, 128, 114)
  AND u.platform_role IN ('support_technician', 'super_admin')
  AND hr.reply_id NOT IN (
    -- Keep the first staff reply (lowest reply_id)
    SELECT * FROM (
      SELECT MIN(hr2.reply_id)
      FROM help_replies hr2
      JOIN users u2 ON hr2.sender_id = u2.user_id
      WHERE hr2.request_id = hr.request_id
        AND u2.platform_role IN ('support_technician', 'super_admin')
      GROUP BY hr2.request_id
    ) AS first_reply
  );

-- Also delete any participant replies after the first staff reply to reset the conversation
DELETE hr FROM help_replies hr
WHERE hr.request_id IN (113, 109, 102, 148, 147, 144, 159, 157, 153, 151, 139, 132, 129, 128, 114)
  AND hr.reply_id NOT IN (
    -- Keep only the first reply (from any sender)
    SELECT * FROM (
      SELECT MIN(hr2.reply_id)
      FROM help_replies hr2
      WHERE hr2.request_id = hr.request_id
      GROUP BY hr2.request_id
    ) AS first_reply
  );

-- Update help_requests to reset statistics for these requests
UPDATE help_requests
SET last_staff_reply_at = NULL,
    resolved_at = NULL,
    updated_at = created_at
WHERE request_id IN (113, 109, 102, 148, 147, 144, 159, 157, 153, 151, 139, 132, 129, 128, 114);

-- Show what's left for verification
SELECT request_id, reply_id, 
       (SELECT username FROM users WHERE user_id = sender_id) as sender,
       (SELECT platform_role FROM users WHERE user_id = sender_id) as role,
       LEFT(reply_content, 50) as content,
       created_at
FROM help_replies
WHERE request_id IN (113, 109, 102, 148, 147, 144, 159, 157, 153, 151, 139, 132, 129, 128, 114)
ORDER BY request_id, reply_id;
